window.bookSummaryJSON = "<p><b>She thought her mom's shifter blood had passed her by. Tossed into the deep end of a mystical realm, will she survive the hot and heavy glamour?</b></p> <p>Mara Reynolds is nauseous with anxiety. With her plans to skip college destroyed by a pair of strangers claiming that she's destined to manifest remarkable abilities, the curious nineteen-year-old agrees to attend a magical school. And overwhelmed by the unknown, the artistic young woman is startled by the tingles of attraction flying between her and the handsome leaders of Spring, Summer, Autumn, and Winter.</p> <p>Digging deeper into the truth of her place in this world, Mara is thrown off balance as all four princes unleash a seductive campaign to earn her kisses. But as she starts to get a grip on their complicated society, a dream reveals that she's about to become tangled up with a curse, a prophecy, and a quartet of fated mates.</p> <p>With everyone playing a game for her heart, can she defeat destiny and make her own rules?</p> <p>Touch of Winter <i>is the spicy first book in the Wyldthorn Academy paranormal romance series. If you like witty prose, vibrant mythologies, and why-choose plotlines, then you'll adore LK Shear's lighthearted adventure.</i></p>"; 
